import { makeAutoObservable } from "mobx";

class DisciplineStore {
  disciplines = [
    { id: 1, name: "Athletics", image: "/images/disciplines/Athletics.svg" },
    { id: 2, name: "Swimming", image: "/images/disciplines/Swimming.svg" },
    { id: 3, name: "Gymnastics", image: "/images/disciplines/Gymnastics.svg" },
    { id: 4, name: "Basketball", image: "/images/disciplines/Basketball.svg" },
    { id: 5, name: "Wrestling", image: "/images/disciplines/Wrestling.svg" },
    { id: 6, name: "Weightlifting", image: "/images/disciplines/Weightlifting.svg" },
    { id: 7, name: "Diving", image: "/images/disciplines/Diving.svg" },
    { id: 8, name: "Table Tennis", image: "/images/disciplines/TableTennis.svg" },
  ];

  constructor() {
    makeAutoObservable(this); // Автоматическая реактивность
  }

  getDisciplineByName(name) {
    return this.disciplines.find((d) => d.name === name);
  }
}

export default new DisciplineStore();
